import React from 'react';
import {Form,Card,Input,Button} from 'antd';

const onFinish = (values) => {
    console.log('Success:', values);
  };

const onFinishFailed = (errorInfo) => {
    console.log('Failed:', errorInfo);
};

function Edit() {
    return (
        <Card title="商品编辑">
            <Form
                labelCol={{
                    span: 8,
                }}
                wrapperCol={{
                    span: 16,
                }}
                name="basic"
                initialValues={{
                    remember: true,
                }}
                onFinish={onFinish}
                onFinishFailed={onFinishFailed}
                autoComplete="off"
            >
                <Form.Item 
                    label="名字"
                    name="username"
                    rules={[
                    {
                        required: true,
                        message: '请输入商品名字',
                    },
                    ]}
                >
                    <Input placeholder="请输入商品名字"/>
                </Form.Item>
                <Form.Item >
                    <Button type="primary">保存</Button>
                </Form.Item>
                <Form.Item
                    wrapperCol={{
                    offset: 8,
                    span: 16,
                    }}
                >
                    <Button type="primary" htmlType="submit">
                    Submit
                    </Button>
                </Form.Item>
            </Form>

        </Card>
    )
}

export default Edit
